function Regions() {
  return (
    <Container className="pt-5 pb-5 border border-2 bg-dark">
      <Carousel data-bs-theme="dark">
        <Carousel.Item className="pb-5">
          <Card className="">
            <Card.Body>
              <Card.Text>
                <small>
                  The Kanto region is a region of the Pokémon world. Kanto is
                  based on the real Kantō region (関東, east of the barrier) in
                  Japan. Kanto is modern and technological. Professor Oak is the
                  resident Pokémon Professor and gives Pokémon Trainers a choice
                  between Bulbasaur, Charmander, or Squirtle as their starter
                  Pokémon. wiki
                </small>
              </Card.Text>
            </Card.Body>
            <Card.Img
              variant="bottom"
              className="d-block w-100"
              // src="holder.js/800x400?text=First slide&bg=373940"
              // src="holder.js/100px180"
              // src="https://picsum.photos/500/350"

              src={kanto}
              style={{ width: 600, height: 400 }}
              // alt="welcome"
              alt="First slide"
              fluid
              rounded
            />
          </Card>
        </Carousel.Item>

        {/* <img
            className="d-block w-100"
            // src="holder.js/800x400?text=First slide&bg=373940"
            src="https://picsum.photos/id/300/200"
            alt="First slide"
            fluid
            rounded
          /> */}
        {/* <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption> */}

        <Carousel.Item>
          <img
            className="d-block w-100 border-light"
            alt="Second slide"
            src="https://picsum.photos/id/28/500/350"
            style={{ width: 500, height: 350 }}
          />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
          <img
            className="d-block w-100"
            alt="Third slide"
            src="https://picsum.photos/id/28/500/350"
            style={{ width: 500, height: 350 }}
          />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </Container>
  );
}

export default Regions;
